import React, { useState, useEffect } from 'react';


const Portfolio = props => {
    return (
        <div>
            <table className="table table-bordered">
                <caption className="text-center">{props.stockName}</caption>
                <tbody>
                    <tr>
                        <td>Price</td>
                        <td>{props.price}</td>
                    </tr>
                </tbody>
            </table>
        </div>
    );
}
 
export default Portfolio;
